apiVersion: operators.coreos.com/v1alpha1
kind: ClusterServiceVersion
metadata:
  annotations:
    alm-examples: "[\n  {\n    \"apiVersion\": \"labs.ai/v1alpha1\",\n    \"kind\"\
      : \"Eddioperator\",\n    \"metadata\": {\n      \"name\": \"eddioperator\"\n\
      \    },\n    \"spec\": {\n      \"image\": {\n        \"image_name\": \"eddi\"\
      ,\n        \"repository\": \"labsai\",\n        \"tag\": \"latest\"\n      },\n\
      \      \"size\": 1\n    }\n  }\n]"
    capabilities: Seamless Upgrades
    categories: AI/Machine Learning, Developer Tools
    certified: 'false'
    containerImage: registry.connect.redhat.com/labsai/eddi
    createdAt: '2019-11-09T12:59:59'
    description: Scalable Open Source Chatbot Platform. Build multiple Chatbots with
      NLP, Behavior Rules, API Connector, Templating.  Developed in Java, provided
      with Docker, orchestrated with Kubernetes or Openshift.
    repository: https://github.com/labsai/EDDI-operator/
    support: Eddi
  name: eddi-operator.v1.0.0
  namespace: placeholder
spec:
  apiservicedefinitions: {}
  customresourcedefinitions:
    owned:
      - description: Eddi operator description
        displayName: EDDI
        kind: Eddioperator
        name: eddioperator.labs.ai
        version: v1alpha1
  description: "## About the managed application\n**Enterprise-Ready Open Source Chatbot\
    \ Platform**\n\ncreate, run and maintain customizable chatbots\n\n\n**Scale Horizontally**\n\
    \nscale out horizontally due to resource-oriented design & RESTful\narchitecture\n\
    \n\n**NLP Parser**\n\nmatch user inputs as words and phrases even in case of spelling\
    \ mistakes or\nmissing spaces between words\n\n\n**Behavior Rules**\n\nmake decisions\
    \ with predefined and custom conditions\n\n\n**Conversation Memory**\n\nstore\
    \ context information between user interactions in order to make better\nconversation\
    \ decisions\n\n\n**Extension Oriented**\n\nbuild loosely coupled plugins that\
    \ allows the integration of new algorithms\nand communication to other systems\n\
    \n\n**Modular Bot Configurations**\n\nshare bot knowledge across bots in order\
    \ to reuse components and thus speed\nup further developments\n\n\n**Versioned\
    \ Configurations**\n\ntrack changes of all of your configurations. Use different\
    \ versions of your\nconfigurations in different bots, to allow multiple bots with\
    \ shared\nknowledge\n\n\n**Developed as Microservices, Restful by Design**\n\n\
    we don't need to comment on that, do we...? ;-) \n\n\n## About this Operator\n\
    Launch and update EDDI instances\n\n## Prerequisites for enabling this Operator\n\
    You need to first launch mongodb before you should launch EDDI, preferably\nwith\
    \ the mongodb operator\n"
  displayName: EDDI Operator
  icon:
    - base64data: 
      mediatype: image/png
  install:
    spec:
      deployments:
        - name: eddi-operator
          spec:
            replicas: 1
            selector:
              matchLabels:
                name: eddi-operator
            strategy: {}
            template:
              metadata:
                labels:
                  name: eddi-operator
              spec:
                containers:
                  - command:
                      - /usr/local/bin/ao-logs
                      - /tmp/ansible-operator/runner
                      - stdout
                    image: registry.connect.redhat.com/labsai/eddi-operator:0.0.4
                    imagePullPolicy: Always
                    name: ansible
                    resources: {}
                    volumeMounts:
                      - mountPath: /tmp/ansible-operator/runner
                        name: runner
                        readOnly: true
                  - env:
                      - name: WATCH_NAMESPACE
                        valueFrom:
                          fieldRef:
                            fieldPath: metadata.annotations['olm.targetNamespaces']
                      - name: POD_NAME
                        valueFrom:
                          fieldRef:
                            fieldPath: metadata.name
                      - name: OPERATOR_NAME
                        value: eddi-operator
                    image: registry.connect.redhat.com/labsai/eddi-operator:0.0.4
                    imagePullPolicy: Always
                    name: operator
                    resources: {}
                    volumeMounts:
                      - mountPath: /tmp/ansible-operator/runner
                        name: runner
                serviceAccountName: eddi-operator
                volumes:
                  - emptyDir: {}
                    name: runner
      permissions:
        - rules:
            - apiGroups:
                - ''
              resources:
                - pods
                - services
                - endpoints
                - persistentvolumeclaims
                - events
                - configmaps
                - secrets
              verbs:
                - '*'
            - apiGroups:
                - apps
              resources:
                - deployments
                - daemonsets
                - replicasets
                - statefulsets
              verbs:
                - '*'
            - apiGroups:
                - monitoring.coreos.com
              resources:
                - servicemonitors
              verbs:
                - get
                - create
            - apiGroups:
                - apps
              resourceNames:
                - eddi-operator
              resources:
                - deployments/finalizers
              verbs:
                - update
            - apiGroups:
                - labs.ai
              resources:
                - '*'
              verbs:
                - '*'
          serviceAccountName: eddi-operator
    strategy: deployment
  installModes:
    - supported: true
      type: OwnNamespace
    - supported: true
      type: SingleNamespace
    - supported: false
      type: MultiNamespace
    - supported: true
      type: AllNamespaces
  keywords:
    - chatbot
    - conversational ui
    - virtual assistant
    - state machine
    - nlp
  labels: {}
  links:
    - name: Project Home
      url: https://eddi.labs.ai
    - name: Professional Support
      url: https://www.labs.ai
    - name: Documentation
      url: http://docs.labs.ai
  maintainers:
    - email: contact@labs.ai
      name: LABS.AI
  maturity: alpha
  provider:
    name: LABS.AI
  selector:
    matchLabels: {}
  version: 1.0.0
